import React, { useState, useEffect, useCallback } from 'react';
import { TextField, Button, Box, Typography, Checkbox, FormControlLabel, Alert } from '@mui/material';
import { Link } from 'react-router-dom';
import { isEmail, isNotEmpty, isEqualToOtherValue, hasMinLength } from '../../util/validation';

export const Signup = () => {
  const initialFormState = {
    name: '',
    email: '',
    password: '',
    confirmPassword: '',
    agreeStatute: false,
    agreeRegimentoInterno: false,
  };

  const [formState, setFormState] = useState(initialFormState);
  const [formError, setFormError] = useState<string | undefined>();
  const [errors, setErrors] = useState<string[]>([]);

  // Handle change of input fields
  const handleChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    const { name, value, type, checked } = e.target;
    setFormState((prevState) => ({
      ...prevState,
      [name]: type === 'checkbox' ? checked : value,
    }));
    setFormError('');
    setErrors([]);
  };

  // Handle form submission
  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    const { name, email, password, confirmPassword, agreeStatute, agreeRegimentoInterno } = formState;
    const errorMessages: string[] = [];

    if (!isNotEmpty(name) || !hasMinLength(name, 10)) {
      errorMessages.push("Nome completo deve ter no mínimo 10 caracteres");
    }

    if (!isNotEmpty(email) || !isEmail(email)) {
      errorMessages.push("Digite um E-mail válido");
    }

    if (!isNotEmpty(password) || !hasMinLength(password, 6)) {
      errorMessages.push("Senha deve ter no mínimo 6 caracteres");
    }

    if (!isEqualToOtherValue(password, confirmPassword)) {
      errorMessages.push("Senha e Confirmação da Senha devem coincidir");
    }

    if (!agreeStatute) {
      errorMessages.push("Confirme o entendimento do Estatuto CPVL");
    }

    if (!agreeRegimentoInterno) {
      errorMessages.push("Confirme o entendimento do Regimento Interno CPVL");
    }

    if (errorMessages.length > 0) {
      setErrors(errorMessages);
      return;
    }

    // Simulating form submission (you would send it to an API here)
    console.log('Form Submitted', formState);
  };

  // Reset form to initial state
  const handleReset = () => {
    setFormState(initialFormState);
    setErrors([]);
    setFormError('');
  };

  return (
    <Box sx={{ display: 'flex', justifyContent: 'center', alignItems: 'center', minHeight: '100vh', backgroundColor: '#f4f6f8' }}>
      <Box sx={{ width: '100%', maxWidth: 400, padding: 3, borderRadius: 2, backgroundColor: 'white', boxShadow: 3 }}>
        <Typography variant="h4" align="center" mb={2}>
          Cadastre-se
        </Typography>
        <Typography variant="body2" align="center" mb={4}>
          Preencha os campos abaixo para criar sua conta.
        </Typography>

        <form onSubmit={handleSubmit}>
          <TextField
            fullWidth
            label="Nome completo"
            name="name"
            value={formState.name}
            onChange={handleChange}
            variant="outlined"
            margin="normal"
            required
          />
          <TextField
            fullWidth
            label="E-mail"
            name="email"
            type="email"
            value={formState.email}
            onChange={handleChange}
            variant="outlined"
            margin="normal"
            required
          />
          <TextField
            fullWidth
            label="Senha"
            name="password"
            type="password"
            value={formState.password}
            onChange={handleChange}
            variant="outlined"
            margin="normal"
            required
          />
          <TextField
            fullWidth
            label="Confirme a senha"
            name="confirmPassword"
            type="password"
            value={formState.confirmPassword}
            onChange={handleChange}
            variant="outlined"
            margin="normal"
            required
          />

          <FormControlLabel
            control={
              <Checkbox
                name="agreeStatute"
                checked={formState.agreeStatute}
                onChange={handleChange}
              />
            }
            label="Li e concordo com o Estatuto CPVL"
          />
          <FormControlLabel
            control={
              <Checkbox
                name="agreeRegimentoInterno"
                checked={formState.agreeRegimentoInterno}
                onChange={handleChange}
              />
            }
            label="Li e concordo com o Regimento Interno CPVL"
          />

          {errors.length > 0 && (
            <Box sx={{ marginTop: 2 }}>
              {errors.map((error, index) => (
                <Alert key={index} severity="error" sx={{ marginBottom: 1 }}>
                  {error}
                </Alert>
              ))}
            </Box>
          )}

          <Box sx={{ marginTop: 2 }}>
            <Button
              variant="outlined"
              color="secondary"
              type="button"
              fullWidth
              sx={{ marginBottom: 2 }}
              onClick={handleReset}
            >
              Limpar
            </Button>
            <Button
              variant="contained"
              color="primary"
              type="submit"
              fullWidth
            >
              Cadastrar
            </Button>
          </Box>
        </form>

        <Box sx={{ marginTop: 3 }}>
          <Typography variant="body2" align="center">
            Já tem conta?{' '}
            <Link to="/login" style={{ textDecoration: 'underline', color: '#1976d2' }}>
              Faça login
            </Link>
          </Typography>
        </Box>
      </Box>
    </Box>
  );
};
